import React from 'react'
import { useParams } from 'react-router-dom';
import '../styles/Recipe.css';
import Rating from '../components/Rating';

export default function Recipe(prop) {

  const { loggedIn } = prop;
  let { id } = useParams();

  const recipes = [
    {
      "picture": "data:image/jpeg;base64,",
      "id": "1",
      "title": "Pasta Carbonara",
      "rating": "4",
      "servings": "4",
      "ingredients": [
          "Spaghetti: 300 g",
          "Bacon: 1 pck (140 g)",
          "Cloves of garlic: 2",
          "Lactose-free food cream (15%): 1 pck (2 dl)",
          "Eggs: 2",
          "Grated parmesan: 1 1/2 dl",
          "Black pepper: 1/2 tsp.",
          "Salt: 1/4 tsp."
      ],
      "time": "30",
      "instructions": "1. Boil the spaghetti according to the instructions on the package and drain it.\n\n2. Slice the bacon and chop the garlic cloves. Brown the bacon in a pan. Add the garlic cloves and fry until softened. In a bowl, mix the cream, eggs, parmesan and spices.\n\n3. Combine pasta and bacon mixture. Mix the cream-egg mixture with the hot pasta. Serve pasta carbonara immediately. If desired, add grated parmesan and freshly ground black pepper to the surface of the portions. ",
      "notes": ""
    },
    {
      "id": 1656848054351,
      "picture": "data:image/webp;base64,",
      "title": "Shakshuka",
      "rating": "4",
      "servings": "4",
      "ingredients": [
          "sipuli: 1 (100 g)",
          "paprika: 1 (200 g)",
          "mieto punainen chili: 1",
          "öljyä: 1 rkl",
          "juustokuminaa eli jeeraa: 1 1/2 tl",
          "paprikaa: 1 tl",
          "suolaa: 1 tl",
          "kikherneitä: 1 tlk (380/230 g)",
          "tomaattisosetta: 2 rkl",
          "kokonaisia kuorittuja tomaatteja: 1 tlk (400 g)",
          "vettä: 1 dl",
          "kananmunaa: 4",
          "mustapippuria: ripaus",
          "tuoretta korianteria hienonnettuna: ripaus"
      ],
      "time": "30",
      "instructions": "1. Kuutioi sipuli ja paprika. Poista chilistä siemenet ja hienonna chilipalko. Kuullota sipulia ja paprikaa öljyssä paistokasarissa, kunnes ne alkavat pehmetä. Lisää juustokumina, paprikajauhe, suola ja hienonnettu chili.\n\n2. Kaada kasariin huuhdotut ja valutetut kikherneet. Lisää tomaattipyree, säilyketomaatit sekä 1 dl vettä (huuhdo säilyketölkki vedellä). Riko säilyketomaattien rakenne lastalla. Anna seoksen kiehahtaa.\n\n3. Lisää kananmunat paistokseen yksi kerrallaan. Riko kananmuna lasiin, tee tomaattiseoksen pinnalle pieni kuoppa ja kaada kananmuna koloon. Tee samoin kaikille kananmunille. Älä enää sekoita, vaan hyydytä kananmunat erillään toisistaan.\n\n4. Hauduta kannen alla miedolla lämmöllä vielä noin 10 minuuttia, tai kunnes kananmunat ovat hyytyneet kypsiksi. Ripottele pinnalle pippuria ja tuoretta korianteria.",
      "notes": ""
    },
    {
      id: 3,
      title: 'Pasta'
    },
  ]

  
  const Recipe = recipes.find(recipe => parseInt(recipe['id']) === parseInt(id));
  
  let splitInstructions = [];
  if (Recipe) {
    splitInstructions = Recipe.instructions.split("\n\n")
  }

  return (
    <div id="recipePage">
      <div id="recipeHero" style={{backgroundImage: `url(${Recipe.picture})`}}>
        { loggedIn && <button id="recipeEditButton">MUOKKAA</button>}
        <h3 id="recipeTitle" >{Recipe.title.toUpperCase()}</h3>
        <div id="recipeShade"></div>
        <div id="recipeRating">
          <Rating rating={Recipe.rating} stylingForm={'RecipePage'}/> 
        </div>
      </div>

      <div>
        <h3 className="recipeSectionTitles">AINESOSAT</h3>
        <p className="recipeUnderTitle">{Recipe.servings} annosta</p>
      </div>

      <div>
        {
          Recipe.ingredients.map(ingredient => {
            const splitIng  = ingredient.split(": ");
            return <div className="recipeIngredients">
              <p>{splitIng[1]}</p>
              <p>{splitIng[0]}</p>
            </div>
          })
        }
      </div>

      <div>
        <h3 className="recipeSectionTitles">OHJEET</h3>
        {
            Recipe.time > 60 ? <p> { Math.floor(Recipe.time / 60) }t {Recipe.time - Math.floor(Recipe.time / 60) * 60} min</p> 
            : <p className="recipeUnderTitle">{Recipe.time} min</p>
          }
      </div>

      <div id="recipeInstructionSection">
        {
          splitInstructions.map((instruction, index) => {
            return <p className="recipeInstruction" key={index}>{instruction}</p>
          })
        }
      </div>

      <div id="recipeFooter">
        <h3>Hyviä ruokahetkiä!</h3>
      </div>
    </div>
  )
}
